class Stack{#t=[];constructor(){}push(t){this.#t.push(t)}pop(){return this.#t.length>0?this.#t.pop():void 0}clear(){this.#t.clear()}get length(){return this.#t.length}get isEmpty(){return 0===this.#t.length}get peek(){return this.#t[this.#t.length-1]}values(){return[...this.#t]}contains(t){return this.#t.includes(t)}display(){console.log(`Stack (${this.#t.length}) {\n ${this.#t.join(", ")}\n}`)}}